    results.innerHTML = '';

        return;
    }

    const matches = searchData.filter(item =>
        item.line.toLowerCase().includes(query) ||
        item.boulder.toLowerCase().includes(query) ||
        item.sector.toLowerCase().includes(query)

            window.open(item.link, '_blank');

    });
